            "unique_identifier": "61cd67ed-c800-4cad-9be6-d529f6b08087",
            "order": 1,
            "title": "As You Get Started\nWe understand that you want to score well on tests. This is NOT a test.\nThis 8-10 minute inventory is about the skills employers value the most. Upon completion you will gain an understanding of your current skill levels. You will also receive recommendations to continue to grow your skills.\nIt is important to answer honestly to reflect where you are today so that you know how close you are to having the skills employers are looking for. If, or when, you take this inventory in the future, you will be able to evaluate your growth.",
            "explanation": null,
            "hint": null,
