        {
            "unique_identifier": "6250e61d-39ab-471c-9e1e-dd4e5f30608c",
            "order": 2,
            "title": "The Skills Employers Value the Most\nThis inventory is centered on the National Association of Colleges and Employers’ (NACE) research that has identified the eight (8) skills that employers value most, which are called the NACE Career Readiness Competencies.\nNACE’s research has defined four (4) skill levels. Below are the definitions. There is also a 5th option for Not Applicable.\nEmerging Knowledge — I have&nbsp;an emerging awareness of the behavior, its importance, and related concepts.\nUnderstanding — I demonstrate an understanding of the behavior and related concepts.\nEarly Application — I sometimes apply the behavior.\nAdvanced Application — The behavior is consistent and integrated into my workplace behaviors.\nNot Applicable — I am just beginning to learn about this skill/behavior.",
            "explanation": null,
            "hint": null,
            "media": [],
            "type": {
                "name": "editor.questions.types.text_only.name",
                "object_name": "plaintext"
            },
